// client/src/ImageUpload.js
import React, { useState } from 'react';
import axios from 'axios';
// import './ImageUpload.css';

function History() {
    const [history, setHistory] = useState([]);

    useEffect(() => {
        const fetchHistory = async () => {
            const token = localStorage.getItem("token");
            const response = await axios.get("http://localhost:5000/api/history", {
                headers: { "userid": "user-id-here" }
            });
            setHistory(response.data.history);
        };
        fetchHistory();
    }, []);

    return (
        <div className="history-container">
            <h2>Upload History</h2>
            {history.map((item, index) => (
                <div key={index}>
                    <p><strong>Image Name:</strong> {item.imageName}</p>
                    <p><strong>Response:</strong> {JSON.stringify(item.response)}</p>
                    <p><strong>Uploaded At:</strong> {new Date(item.uploadedAt).toLocaleString()}</p>
                </div>
            ))}
        </div>
    );
}

export default HistoryPage;
